pub enum Block {

    /// Image block.
    Image = ,

    /// Extension block.
    Extension = ,

    /// Image trailer.
    Trailer = ,
}

pub enum Extension {

    /// Text extension.
    Text = ,

    /// Control extension.
    Control = ,

    /// Comment extension.
    Comment = ,

    /// Application extension.
    Application = ,
}

pub enum DecodingError {

    /// Returned if the image is found to be malformed.
    Format(&'static str),

    /// Internal (logic) error.
    Internal(&'static str),

    /// Wraps `std::io::Error`.
    Io(io::Error),
}

pub enum Extensions {

    /// Saves all extention data
    Save,

    /// Skips the data of unknown extensions
    /// and extracts the data from known ones
    Skip,
}

pub enum Decoded<'a> {

    /// Decoded nothing.
    Nothing,

    /// Global palette.
    GlobalPalette(Vec<u8>),

    /// Index of the background color in the global palette.
    BackgroundColor(u8),

    /// Decoded the image trailer.
    Trailer,

    /// The start of a block.
    BlockStart(Block),

    /// Decoded a sub-block. More sub-block are available.
    SubBlockFinished(u8, &'a [u8]),

    /// Decoded the last (or only) sub-block of a block.
    BlockFinished(u8, &'a [u8]),

    /// Decoded all information of the next frame.
    /// The returned frame does **not** any image data.
    Frame(&'a Frame),

    /// Decoded some data of the current frame.
    Data(&'a [u8]),

    /// No more data available the current frame.
    DataEnd,
}

pub enum ColorOutput {

    /// The decoder expands the image data to 32bit RGBA.
    /// This affects:
    ///
    ///  - The buffer buffer of the `Frame` returned by `Reader::read_next_frame`.
    ///  - `Reader::fill_buffer`, `Reader::buffer_size` and `Reader::line_length`.
    RGBA = ,

    /// The decoder returns the raw indexed data.
    Indexed = ,
}

pub enum Repeat {

    /// Finite number of repetitions
    Finite(u16),

    /// Infinite number of repetitions
    Infinite,
}

pub enum ExtensionData {

    /// Control extension. Use `ExtensionData::new_control_ext` to construct.
    Control {
        /// Flags.
        flags: u8,
        /// Frame delay.
        delay: u16,
        /// Transparent index.
        trns: u8,
    },

    /// Sets the number of repetitions
    Repetitions(Repeat),
}
